const e="ReFa Reader",t="https://uclab.fh-potsdam.de/refa-catalog/api",i="https://uclab.fh-potsdam.de/refa-catalog/s/c",s=["en","de"],a={en:"This visual interface is an outcome of the <a href='https://uclab.fh-potsdam.de/refa'>Restaging Fashion</a> project. It provides access to a selection of objects from the Lipperheidesche Kostümbibliothek. Essays are juxtaposed with a graph navigation that allows the user to browse the paintings, prints, drawings and clothes in the collection. Instead of showing the collection in its entirety, it is accessible through a curated selection of essays designed to provide a better understanding of it, combining editorial approaches with free exploration and user-driven granularity.",de:"Dieses visuelle Interface ist ein Resultat des <a href='https://uclab.fh-potsdam.de/refa'>Restaging Fashion</a>-Projekts. Es bietet Zugang zu einer Auswahl von Objekten aus der Lipperheideschen Kostümbibliothek. Die einführenden Texte verlinken über Graphen zu den Sammlungsobjekten. Die Essays werden einer Grafik gegenübergestellt, die es dem Benutzer ermöglicht, die Gemälde, Drucke, Zeichnungen und Kleider der Sammlung zu durchsuchen. Anstatt die Sammlung in ihrer Gesamtheit zu zeigen, wird sie einführend durch eine kuratierte Objektauswahl zugänglich gemacht, die ein besseres Verständnis der Sammlung ermöglichen und redaktionelle Ansätze mit freier Erkundung und benutzergesteuerter Granularität kombinieren."},n=30,o=[{key:"Related Artworks",props:["is refered to it","shows features of","is shown by","is type of","created","features are also found on"]},{key:"Documentation",props:["is documented in","incorporates"]},{key:"",props:["media","item"]}],r="An interactive visualisation that provides access to a selection of objects from the Lipperheidesche Kostümbibliothek. Essays are juxtaposed with a graph navigation that allows the user to browse the paintings, prints, drawings and clothes in the collection. Instead of showing the collection in its entirety, it is accessible through a curated selection of essays designed to provide a better understanding of it, combining editorial approaches with free exploration and user-driven granularity.",c="https://uclab.fh-potsdam.de/refa-catalog/files/large/c70c26ab79548a46066efc31bf517afc08127c66.jpg",d={title:e,api:t,publicSite:i,languages:s,description:a,batch:n,mainCategories:o,descriptionSeo:r,imageSeo:c},l=Object.freeze(Object.defineProperty({__proto__:null,api:t,batch:n,default:d,description:a,descriptionSeo:r,imageSeo:c,languages:s,mainCategories:o,publicSite:i,title:e},Symbol.toStringTag,{value:"Module"}));export{r as a,t as b,l as c,a as d,n as e,c as i,s as l,o as m,e as t};
